/* qpsol:(h[14x14,64nz],g[14],a[1x14,1nz],lba,uba,lbx[14],ubx[14],x0[14],lam_x0[14],lam_a0,q[],p[])->(x[14],cost,lam_a,lam_x[14]) */
static int casadi_f6(const casadi_real** arg, casadi_real** res, casadi_int* iw, casadi_real* w, int mem) {
  char buf[121];
  int flag;
  struct casadi_qp_data d;
  struct casadi_qp_prob p;
  p.sp_a = casadi_s0;
  p.sp_h = casadi_s1;
  p.sp_at = casadi_s2;
  p.sp_kkt = casadi_s3;
  p.sp_v = casadi_s4;
  p.sp_r = casadi_s5;
  p.prinv = casadi_s6;
  p.pc =  casadi_s6;
  casadi_qp_setup(&p);
  p.max_iter = 1000;
  p.min_lam = 0;
  p.constr_viol_tol = 1e-008;
  p.dual_inf_tol = 1e-008;
  d.prob = &p;
  d.nz_h = arg[0];
  d.g = arg[1];
  d.nz_a = arg[2];
  casadi_qp_init(&d, &iw, &w);
  /* Pass bounds on z */
  if (arg[5]) {
    casadi_copy(arg[5], 14, d.lbz);
  } else {
    casadi_fill(d.lbz, 14, -casadi_inf);
  }
  if (arg[3]) {
    casadi_copy(arg[3], 1, d.lbz+14);
  } else {
    casadi_fill(d.lbz+14, 1, -casadi_inf);
  }
  if (arg[6]) {
    casadi_copy(arg[6], 14, d.ubz);
  } else {
    casadi_fill(d.ubz, 14, casadi_inf);
  }
  if (arg[4]) {
    casadi_copy(arg[4], 1, d.ubz+14);
  } else {
    casadi_fill(d.ubz+14, 1, casadi_inf);
  }
  /* Pass initial guess */
  if (arg[7]) {
    casadi_copy(arg[7], 14, d.z);
  } else {
    casadi_clear(d.z, 14);
  }
  casadi_fill(d.z+14, 1, casadi_nan);
  if (arg[8]) {
    casadi_copy(arg[8], 14, d.lam);
  } else {
    casadi_clear(d.lam, 14);
  }
  if (arg[9]) {
    casadi_copy(arg[9], 1, d.lam+14);
  } else {
    casadi_clear(d.lam+14, 1);
  }
  /* Solve QP */
  if (casadi_qp_reset(&d)) return 1;
  while (1) {
    flag = casadi_qp_prepare(&d);
    if (d.iter % 10 == 0) {
      if (casadi_qp_print_header(&d, buf, sizeof(buf))) break;
      CASADI_PRINTF("%s\n", buf);
    }
    if (casadi_qp_print_iteration(&d, buf, sizeof(buf))) break;
    CASADI_PRINTF("%s\n", buf);
    if (flag || casadi_qp_iterate(&d)) break;
  }
  /* Get solution */
  if (res[1]) casadi_copy(&d.f, 1, res[1]);
  if (res[0]) casadi_copy(d.z, 14, res[0]);
  if (res[3]) casadi_copy(d.lam, 14, res[3]);
  if (res[2]) casadi_copy(d.lam+14, 1, res[2]);
  return d.status != QP_SUCCESS;
  return 0;
}

